function Bonus(props) {
  let bonus = props.value ? (
    <span className="block mx-auto w-8 text-sm bg-slate-500 text-white rounded-lg font-bold">+{props.value}</span>
  ) : null

  return (
    <>
      { bonus }
    </>
  )
}

export default Bonus;
